import { Container } from "reactstrap";
import Header from "../Nav/Header";
import '../../css/Dashboard.css';
import Sidebar from "../Sidebar/Sidebar";


function Dashboard(){
    return(
        <div>
            <Sidebar/>
            <div className="main-panel">
                <Container fluid={true}>
                    <Header/>
                </Container>
            </div>
        </div>
    );
}
export default Dashboard;
